import "./singlePost.css"

export default function SinglePost() {
    return (
        <div className="singlePost">
            <div className="singlePostWrapper">
                <img className="Img" src="https://images.pexels.com/photos/1237119/pexels-photo-1237119.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940" alt="" className="singlePostImg" />
             <h1 className="singlePostTitle">
                 Lorem ipsum dolor, sit amet consaut soluta!
             </h1>
            </div>
        </div>
    )
}
